    "    psi = u_real + 1j*u_imag\n",
    "    plt.plot(r, np.abs(psi)**2, label=f\"t={df.iloc[i,0]:.2f}\")\n",
    "plt.xlabel(\"r\")\n",
    "plt.ylabel(\"|psi(r)|^2\")\n",
    "plt.legend()\n",
    "plt.show()\n"
